import{SETLONGIN} from'../Contant/Contant'
import axios from "axios";


export const AddAction=({email: login,
    password: matkhau,})=>{
    const data= axios 
    .post("http://localhost:5000/users/login", {
        email: login ,
        password: matkhau

      })
      .then


    return{
        type:SETLONGIN,
        payload:data

    }
}
